document.addEventListener("DOMContentLoaded",function(){const n=new Set,d=document.querySelectorAll("astro-embed-gist:not([data-css-loaded])");d.forEach(s=>{s.dataset.cssLoaded="true",console.log("adding css",d.length,s.dataset.cssurl);const e=s.dataset.cssurl;if(!e||n.has(e))return;n.add(e);const t=document.createElement("link");t.href=e,t.rel="stylesheet",t.type="text/css",document.head.appendChild(t)})});
